window.bookSummaryJSON = "<p><b>Old Marines never die.... They just become Space Marines.</b></p> <p>I thought the hard part of helping the Helta defeat the rampaging Tevynians would be the fighting. How wrong I was.</p> <p>To the Helta, we Earthers look just like the Tevynians, their mortal enemies. And convincing their government to ally with humans may be even beyond the crew of the starship <i>James Bowie</i>.</p> <p>But the clock is ticking, because the Tevynian fleet is bearing down on the Helta homeworld. If we canâ€™t talk the Helta into accepting our help to fight them off, then Helta Prime will fall....</p> <p>And Earth will be next.</p>"; 
